        {/* <!-- Area Chart --> */}
        <GenericDivBlock col="col-xl-8 col-lg-7" Heading="Earnings Overview" />
        <GenericDivBlock col="col-xl-8 col-lg-7" Heading="Earnings Overview" />
      </div>
    </React.Fragment>
  );
};

export default ContentRow;
